import React, { Component } from "react";

import HeroSection from "../components/HeroSection/HeroSectionSignUp";

class SignUp extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="main">
          <HeroSection />
        </div>
      </React.Fragment>
    );
  }
}

export default SignUp;
